CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_SHOLAT_SUBUH`(IN `V_BLAP_ID` VARCHAR(35), IN `V_KEC_ID` VARCHAR(35))
SELECT 
	DBLAP_SEQN
    , MAX(IF(ILAP_ID='F08', DBLAP_VALUE,''))AS F08
    ,MAX(IF(ILAP_ID='F09', DBLAP_VALUE,''))AS F09
