    ,MAX(IF(ILAP_ID='F28', DBLAP_VALUE,''))AS F28
    ,MAX(IF(ILAP_ID='F29', DBLAP_VALUE,''))AS F29
    ,MAX(IF(ILAP_ID='F30', DBLAP_VALUE,''))AS F30
